import React from 'react';

const SearchResult = ({ courses }) => {
    return (
        <div>
            <h2>Search Results</h2>
            {courses.length > 0 ? (
                <ul>
                    {courses.map(course => (
                        <li key={course.id}>
                            <h3>{course.name}</h3>
                            <p>{course.description}</p>
                        </li>
                    ))}
                </ul>
            ) : (
                <p>No courses found.</p>
            )}
        </div>
    );
};

export default SearchResult;
